import React from 'react';
import Nav from './Nav/Nav';
import './Material.css';

const Material = () => {
  // Example data
  const detailsData = [
    {
      name: 'John Doe',
      date: '2024-03-12',
      dueDate: '2024-03-20',
      material: 'Book',
      studentId: '12345',
      description: 'Lorem ipsum',
      action: 'Read',
    },
    // Add more data as needed
  ];

  return (
    <div className='materialContainer'>
      <Nav />
      <p className='title'>Student Details</p>
      <div className='contentContainer2'>
        {detailsData.map((details, index) => (
          <div key={index} className='infoRow'>
            <div className='detail'>
              <p className='name'>Name: {details.name}</p>
              <p className='date'>Date: {details.date}</p>
              <p className='duedate'>Due Date: {details.dueDate}</p>
              <p className='materials'>Material: {details.material}</p>
              <p className='sid'>Student ID: {details.studentId}</p>
              <p className='des'>Description: {details.description}</p>
              <p className='action'>Action: {details.action}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Material;
